import React from 'react';

const Table = ()=>{


    return (
        <tr>
            <td>a</td>
            <td>b</td>
            <td><img src="https://assets.coingecko.com/coins/images/1/large/bitcoin.png?1547033579" width="20px" /></td>
            <td>d</td>
            <td>e</td>
            <td>f</td>
        </tr>
    )
}

export default Table;
